import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";
import Para from "./Para";
import Yasir from "./Yasir";

function App() {
  <>
    <Heading />
    <Para />
    <Yasir />
    <Yasir />
    <Yasir />
    <Yasir />
    <Yasir />
    <Yasir />
  </>;
}

export default App;
